import React from "react"
import NavBar from "./components/navbarComp/NavBar"
import "./style.css";
import introImg from "./introImg.png"
import assassin from "./assassin.jpg"
import smoke from "./smokeCenter.jpg"
import smokeside from "./smoke.png"
function App() {
  return (
    <div className="App">
    <NavBar/>
    <img className="smoke" src={smoke} alt="smoke"></img>
    <div className="divIntroImg"><img src={introImg} alt="introImg"></img></div>
    <div className="divAssassinImg"><img className="assassinImg" src={assassin} alt="introImg"></img></div>
    <div className="divNew"></div>
    <div className="divApropos"></div>
    <div className="divBlue"></div>
    <div className="divNew"></div>
    </div>
  );
}

export default App;
